const App = () => {
  return (
      <main>
        <Formulario action="">
           <div>

         <Label htmlFor="">Usuario</Label>
        <Grupoinput>
        <Input type="text" placeholder="usuario"/>
        <IconoValidacion icon={faCircleCheck}/>
        </Grupoinput>
        <LeyendaError>"tu mama es hermosa"</LeyendaError>

       </div>

        </Formulario>

        <div>
          <label>
            <input name="terminos" id="terminos" type="checkbox"/>
            Acepto los terminos y condiciones.
          </label>
        </div>

      </main>
  );
}

export default App;
